import React, {useState, useRef} from 'react';
import {
  StyleSheet,
  Text,
  View,
  Image,
  ScrollView,
  FlatList,
  TouchableOpacity,
  Dimensions,
  Alert,
} from 'react-native';
import MapView, {Polygon} from 'react-native-maps';
import {PROVIDER_GOOGLE, Marker, Polyline} from 'react-native-maps';
import styles from '../Styles/MapTaskStyles';
import Geolocation from '@react-native-community/geolocation';
import {GooglePlacesAutocomplete} from 'react-native-google-places-autocomplete';
import Ionicons from 'react-native-vector-icons/Ionicons';

const MapTask = () => {
  const center = {
    lat: 51.505,
    lng: -0.09,
  };

  const list = [
    {
      coordinate: {
        latitude: 35.689487,
        longitude: 139.691711,
        latitudeDelta: 0.8,
        longitudeDelta: 0.5,
      },
      id: '1',
      title: 'Tokyo',
      image:
        'data:image/jpeg;base64,',
    },
    {
      coordinate: {
        latitude: 51.919437,
        longitude: 19.145136,
        latitudeDelta: 0.8,
        longitudeDelta: 0.5,
      },
      id: '2',
      title: 'Poland',
      image:
        'data:image/jpeg;base64,',
    },
    {
      coordinate: {
        latitude: 30.37532,
        longitude: 69.345116,
        latitudeDelta: 0.8,
        longitudeDelta: 0.5,
      },
      id: '3',
      title: 'Pakistan',
      image:
        'data:image/jpeg;base64,',
    },
    {
      coordinate: {
        latitude: 46.818188,
        longitude: 8.227512,
        latitudeDelta: 0.8,
        longitudeDelta: 0.5,
      },
      id: '4',
      title: 'Switzerland',
      image:
        'data:image/jpeg;base64,',
    },
  ];

  const [draggable, setDraggable] = useState();
  const [position, setPosition] = useState(center);
  const [currentLatitude, setCurrentLatitude] = useState();
  const [currentLongitude, setCurrentLongitude] = useState();
  const mapRef = useRef(null);

  const getmylocation = () => {
    Geolocation.getCurrentPosition(
      position => {
        const currentLongitude = JSON.stringify(position.coords.longitude);
        const currentLatitude = JSON.stringify(position.coords.latitude);
        setCurrentLongitude(currentLongitude);
        setCurrentLatitude(currentLatitude);
      },
      error => alert(error.message),
      {
        enableHighAccuracy: true,
        timeout: 20000,
        maximumAge: 1000,
      },
    );
    const getlocation = {
      latitude: currentLatitude,
      longitude: currentLongitude,
      latitudeDelta: 0.8,
      longitudeDelta: 0.5,
    };
    mapRef.current.animateToRegion(getlocation, 3000);
  };

  const zoomin = () => {
    const zoom_in = {
      latitude: mapRef.current.props.initialRegion.latitude,
      longitude: mapRef.current.props.initialRegion.longitude,
      latitudeDelta: mapRef.current.props.initialRegion.latitudeDelta * 0.3,
      longitudeDelta: mapRef.current.props.initialRegion.longitudeDelta * 0.3,
    };
    mapRef.current.animateToRegion(zoom_in, 3000);
  };

  const zoomout = () => {
    const zoom_out = {
      latitude: mapRef.current.props.initialRegion.latitude,
      longitude: mapRef.current.props.initialRegion.longitude,
      latitudeDelta: mapRef.current.props.initialRegion.latitudeDelta / 0.3,
      longitudeDelta: mapRef.current.props.initialRegion.longitudeDelta / 0.3,
    };
    mapRef.current.animateToRegion(zoom_out, 3000);
  };

  return (
    <View style={styles.container}>
      <MapView
        style={styles.map}
        ref={mapRef}
        followsUserLocation={true}
        initialRegion={position}
        onRegionChangeComplete={region => setPosition(region)}>
        <Marker
          draggable={true}
          coordinate={position}
          onDragEnd={e => setDraggable({x: e.nativeEvent.coordinate})}
        />
        <GooglePlacesAutocomplete
          placeholder="Where From?"
          styles={{
            container: {
              flex: 0,
            },
            textInput: {
              fontSize: 18,
            },
          }}
          onPress={(data, details = null) => {
            const findregion = {
              latitude: details.geometry.location.lat,
              longitude: details.geometry.location.lng,
              latitudeDelta: 0.8,
              longitudeDelta: 0.5,
            };
            //console.log(details.geometry.location);
            mapRef.current.animateToRegion(findregion, 3000);
          }}
          fetchDetails={true}
          query={{
            key: 'AIzaSyCCmDcOmHr-M78fu7sOsqK7mWiSShlGJhQ',
            language: 'en',
          }}
        />
      </MapView>

      <TouchableOpacity onPress={() => zoomin()}>
        <Ionicons name="add" size={40} color="blue" />
      </TouchableOpacity>

      <TouchableOpacity onPress={() => zoomout()}>
        <Ionicons name="remove" size={40} color="blue" />
      </TouchableOpacity>

      <TouchableOpacity onPress={() => getmylocation()}>
        <Ionicons name="locate" size={40} color="blue" />
      </TouchableOpacity>

      <View style={styles.flexbox}>
        <ScrollView>
          <FlatList
            horizontal
            data={list}
            keyExtractor={list.id}
            renderItem={({item}) => (
              <View>
                <TouchableOpacity
                  onPress={() =>
                    mapRef.current.animateToRegion(item.coordinate, 3000)
                  }>
                  <Image source={{uri: item.image}} style={styles.image} />
                </TouchableOpacity>
                <Text style={styles.title}>{item.title}</Text>
              </View>
            )}
          />
        </ScrollView>
      </View>
    </View>
  );
};

export default MapTask;
